from astropy.units.physical import PhysicalType, get_physical_type


acceleration: PhysicalType = get_physical_type('acceleration')
angle: PhysicalType = get_physical_type('angle')
length: PhysicalType = get_physical_type('length')
mass: PhysicalType = get_physical_type('mass')
speed: PhysicalType = get_physical_type('speed')
temperature: PhysicalType = get_physical_type('temperature')
time: PhysicalType = get_physical_type('time')
